import React from "react";
import Person from "./Person/Person";

export default (props) => {
  const persons = props.persons.map((person, index) => {
    return <Person key = {index} age = {person.age} name = {person.age} onClick = {props.clicked} changed = {props.nameChanged.bind(index)}></Person>
    }
  );
  return persons;
};
